import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click the 'My Events' navigation link
    await page.waitForSelector('a.nav-link[href="dashboard.html"]');
    await page.click('a.nav-link[href="dashboard.html"]');

    // Wait for the navigation to complete
    await page.waitForLoadState('networkidle');

    // Take screenshot after navigation
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_navigated_to_my_events.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_navigated_to_my_events.png'));

    // Extract meaningful data to verify task completion
    const pageTitle = await page.title();
    const isOnMyEventsPage = pageTitle.includes("My Events");

    return {
      success: true,
      action: "Navigated to My Events page successfully",
      extractedData: { isOnMyEventsPage },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the 'My Events' link to appear and click it
    await page.waitForSelector('a.nav-link[href="dashboard.html"]', { timeout: 5000 });
    await page.click('a.nav-link[href="dashboard.html"]');

    // Wait for navigation to complete and take a screenshot of the dashboard
    await page.waitForLoadState('networkidle');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_navigated_to_my_events.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_navigated_to_my_events.png'));

    // Verify the navigation was successful by checking the page title
    const pageTitle = await page.title();
    const expectedTitle = 'When2Meet - Find the perfect time for everyone';
    if (pageTitle !== expectedTitle) {
      throw new Error(`Navigation failed. Expected title: ${expectedTitle}, but got: ${pageTitle}`);
    }

    return {
      success: true,
      action: "Navigated to My Events page successfully",
      extractedData: { pageTitle },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

